  false,\n\t\"url\": null,\n\t\"notes\": \"Groundfish diet data collected during the
  Alaska Fisheries Science Center (NOAA/NMFS) groundfish surveys in the eastern Bering
  Sea, Aleutian Islands, and Gulf of Alaska regions from 1981 to the present. Groundfish
  diet data are also collected by fishery observers aboard commercial fishing vessels.
  Diet data is associated with corresponding haul location data. Diet data is described
  to the lowest practical taxon with the exception of fish and crab prey which a generally
  described to the species level. These data are in an Oracle 11g. nnnnnnnnnnnnnnnn\",\n\t\"owner_org\":
